import React from "react";
import { Space } from "antd";
import ProjectCard from "./ProjectCard"
import { projects } from "./Projects"

const Portfolio = () => {
  // Generate a list of project cards with the given the project list.
  const makeProjectCards = (projectList, outCardList) => {
    projectList.forEach((project, index) => {
      outCardList.push(
        <ProjectCard 
          key={index}
          title={project.name}
          description={project.description}
          tags={project.tags}
          detail={project.detail}
          coverSrc="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png"
        />
      );
    });
  }

  let projectCards = [];
  makeProjectCards(projects, projectCards);

  return (
      <div className="portfolio-wrapper">
        <h2>Portfolio</h2>
        <Space wrap size="large" align="center">
          {projectCards}
        </Space>
      </div>
  );
}; 

export default Portfolio;
